import React, { Component } from 'react'


export class LandlordShow extends Component {
    constructor(props) {
        super(props);

        let paramsId = parseInt(this.props.match.params.id, 10)
        let landlord = props.landlords.find(landlord => landlord.id === paramsId);

        this.state = {
            landlord: landlord ? landlord : { name: 'N/A', age: 'N/A', state: 'N/A' }
        }
    }

    render() {

        return (

            < div >
                <h3>This is the specific landlor show page</h3>

            </div >
        )
    }
}

export default connect(null)(LandlordShow)
